import React from "react";

export default function TodoList() {

    return (
        <>
            <Form />
        </>
    );

}

function Form() {

    return (
        <>
            <section className="container-fluid">
                <div className="row">
                    <div className="col-5">
                        <div className="card">
                            <div className="card-header">

                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
}
